import React, {useState} from "react";
import "./index.less"
const SnackGame = () => {
    let blockMaping = require('../../json/maping.json');
    return(
        <div>
            <div className = "snake-game-container">
            {
                blockMaping.map((value)=>{
                    return(
                        <div id ={value.block} data-for-ladder = {value.ladder} data-for-snack = {value.snack}> {value.block}</div>
                    )
                })
            }
            </div>
        </div>
    )
}
export default SnackGame
